import React from 'react';
import './App.css';
import Header from './Header.js'
import Main from './Main.js'
import Footer from './Footer.js'


function App() {
  return (
    <div className="container">
      <div className="main-content">
      <img src="../mark-with-food.jpg" className="main-img" />
        <Header />
        <Main />
      </div>
      <Footer />
    </div>
  );
}

export default App;
